import React from 'react';
import BookShelf from './BookShelf';
import Footer from './Footer';
import Book1 from "./OpeningBooks/Book1";
import Book2 from "./OpeningBooks/Book2";
import Book3 from "./OpeningBooks/Book3";
import Book4 from "./OpeningBooks/Book4";
import Book5 from "./OpeningBooks/Book5";
import Book6 from "./OpeningBooks/Book6";
import Book7 from "./OpeningBooks/Book7";
import {  useNavigate } from 'react-router-dom';


const Landing = () => {

    const navigate = useNavigate();

    return (
        <div className="flex flex-wrap items-center">
            <body className="grid grid-cols-2 gap-8 text-gray-500 sm:gap-12 sm:grid-cols-3 lg:grid-cols-6 dark:text-gray-400">
                <div className="mr-auto place-self-center lg:col-span-7">
                    <div className="flex items-center lg:justify-center">
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`band/new`)}>
                        <Book1/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`giraffe/new`)}>
                        <Book2/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`judge/new`)}>
                        <Book3/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`magic/new`)}>
                        <Book4/>
                    </div>
                </div>
                <div className="flex justify-center mt-3">
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`movie/new`)}>
                        <Book5/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`vacation/new`)}>
                        <Book6/>
                    </div>
                    <div className="cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`wonder/new`)}>
                        <Book7/>
                    </div>
                    </div>
                </div>
            </body>
            <section class="bg-gray-50 dark:bg-gray-800">
                <div class="max-w-screen-xl px-4 py-8 mx-auto lg:py-16 lg:px-6">
                    <div class="max-w-screen-sm mx-auto text-center">
                        <h2 class="mb-4 text-3xl font-extrabold leading-tight tracking-tight text-gray-900 dark:text-white">Start your free trial today</h2>
                        <p class="mb-6 font-light text-gray-500 dark:text-gray-400 md:text-lg">Try Landwind Platform for 30 days. No credit card required.</p>
                        <a href="#" class="text-white bg-purple-700 hover:bg-purple-800 focus:ring-4 focus:ring-purple-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 dark:bg-purple-600 dark:hover:bg-purple-700 focus:outline-none dark:focus:ring-purple-800">Free trial for 30 days</a>
                    </div>
                </div>
            </section>
        </div>
    );
};

export default Landing;
